INSERT INTO `courses` VALUES (1,4,1,'Javascript for Beginners','Learn javascript online and supercharge your web design with this Javascript for beginners training course.','Take this Javascript training course and start learning Javascript today.\n\n\"As a business guy I have no place in programming.\" Ten years ago you could have gotten away with that statement. Today you say that to your colleagues and they scoff at you before they go back to their computers to fix real problems and do real work.\n\nIf you want to do something useful start by learning Javascript . In these days when the browser is central to all computer use knowing \"the language of the browser\" is the most important step. A few years ago Javascript potential was uncertain and many programmers considered it useless. These days however competent programmers have identified Javascript real potential and uses and it has gone from a toy language to the main language of the browser. It has become one of the most useful languages of this era. Every developer needs at least a basic understanding of Javascript. A developer who knows Javascript is the rockstar of the company and is in constant demand by employers. Our online Javascript\n\ncourse will get you started by teaching all the essential aspects of coding in Javascript. So... what\'s it gonna be? Do you want to supercharge your career and be in constant demand by employers? Do you want to learn how to create dynamic and innovative Javascript documents? Start programming today with our Javascript course for Beginners training and take control of your career.',2,'2023-05-02 00:00:00',,5,999000,NULL),(2,6,2,'React basic in just 1 hour [2022]','The quick guide to learn basic concepts and workflow of how to build React app','This short course will cover basic and core concepts that you need to know to get up and running with ReactJS.\n\nReact JS is a Javascript library for building user interfaces. It\'s flexible, fast, easy to learn and fun to work with. ReactJS is designed to make the process of building modular, reusable user interface components simple and intuitive. React was developed at Facebook and focuses on the \'View\' aspect of MVC in web applications. React was built for the purpose of developing applications that are large in nature and have to deal with time changing data.',2,'2023-06-02 00:00:00',,0,899000,NULL),(3,7,3,'Web Design for Beginners: Real World Coding in HTML & CSS','Launch a career as a web designer by learning HTML5, CSS3, responsive design, Sass and more!','You can launch a new career in web development today by learning HTML & CSS. You don\'t need a computer science degree or expensive software. All you need is a computer, a bit of time, a lot of determination, and a teacher you trust. I\'ve taught HTML and CSS to countless coworkers and held training sessions for fortune 100 companies. I am that teacher you can trust. ',2,'2023-07-02 00:00:00',,0,1999000,NULL),(4,8,4,'Angular - The Complete Guide (2023 Edition)','Master Angular (formerly \"Angular 2\") and build awesome, reactive web apps with the successor of Angular.js','Join the most comprehensive and bestselling Angular course on Udemy and learn all about this amazing framework from the ground up, in great depth!\n\nThis course starts from scratch, you neither need to know Angular 1 nor Angular 2!\n\nFrom Setup to Deployment, this course covers it all! You\'ll learn all about Components, Directives, Services, Forms, Http Access, Authentication, Optimizing an Angular App with Modules and Offline Compilation and much more - and in the end: You\'ll learn how to deploy an application!\n\nBut that\'s not all! This course will also show you how to use the Angular CLI and feature a complete project, which allows you to practice the things learned throughout the course!\n\nAnd if you do get stuck, you benefit from an extremely fast and friendly support - both via direct messaging or discussion. You have my word! ;-)',2,'2023-08-02 00:00:00',,0,799000,NULL),(5,10,5,'All about NodeJS','Create & Deploy High Performance Node JS Apps on the Cloud and More !','NodeJS is a platform that allows developers to write server side high performance and networked applications. And that too using good old Javascript. But wait ! Isn\'t Javascript meant to be used for forms and stuff on web pages ?',2,'2023-09-02 00:00:00',,4.1,455000,NULL),(6,11,8,'PHP for Beginners Part 1: all code used is fully explained','PHP for Beginners: Learn to Code in PHP. Every line of code explained in detail. A true PHP for Beginners Course 2022','Students consistently say how much they LOVE this course due to its unique delivery method and challenges which enable you to use your new skills immediately. Join over 6000 other students who have successfully learnt to code in PHP by enrolling in this course.',2,'2023-10-02 00:00:00',,0,233000,NULL),(7,9,7,'HTML5 Essentials for Beginners','Discover the essentials of HTML5 during this 1 hour crash course.','If you are unaware of the new the features and tags that HTML5 offers, HTML5 Essentials for Beginners is a course intended for you. This insightful and fast paced overview will help you quickly discover exactly what makes HTML5, the 5th revision of HTML, such an important standard to learn.',2,'2023-11-02 00:00:00',,4,555000,NULL),(8,4,9,'Learn Python: The Complete Python Programming Course','Learn A-Z everything about Python, from the basics, to advanced topics like Python GUI, Python Data Analysis, and more!','Python has rapidly become one of the most popular programming languages around the world. Compared to other languages such as Java or C++, Python consistently outranks and outperforms these languages in demand from businesses and job availability. The average Python developer makes over $100,000 - this number is only going to grow in the coming years.',2,'2023-12-02 00:00:00',,4,999000,NULL),(9,5,10,'Deep Learning Prerequisites: Linear Regression in Python','Data science, machine learning, and artificial intelligence in Python for students and professionals','This course teaches you about one popular technique used in machine learning, data science and statistics: linear regression. We cover the theory from the ground up: derivation of the solution, and applications to real-world problems. We show you how one might code their own linear regression module in Python.',0,'2023-11-02 00:00:00',,0,2199000,NULL),(10,12,1,'JavaScript from Beginner to Expert','Become a JavaScript expert in 30 days, even if you are a JS beginner. Become a front-end developer of websites in JS','The total length of the JavaScript course is over 12 hours! You will learn theory and you will also gain lots of practice. During the course, I will explain to you how to write real-life applications, like galleries with thumbnails, image sliders, etc.',2,'2023-11-02 00:00:00',,0,1699000,NULL),(11,13,1,'Javascript for Beginners Learn by Doing Practical Exercises','JavaScript for Beginners : Work closely with me doing exercises & learn more. I make Javascript easy for you guaranteed.',' This course if for absolute beginners, and it is an introduction to the major components of javascript. By learning the bigger things in Javascript, you will be able to know how to put the remaining pieces together and will be able to get into advanced courses more prepared. ',2,'2023-11-03 00:00:00',,0,999000,NULL),(12,14,2,'Advanced React and Redux','Walkthroughs on advanced React v16.6.3 and Redux v4.0.0 - Authentication, Testing, Middlewares, HOC\'s, and Deployment','Mastering React and Redux can get you a position in web development or help you build that personal project you\'ve been dreaming of. It\'s a skill that will put you more in demand in the modern web development industry, especially with the release of Redux and ReactNative.',2,'2023-11-04 00:00:00',,0,1699000,NULL),(22,5,1,'a','2','',0,NULL,,0,12324,'2023-03-20 10:30:39'),(23,11,25,'123','123','123',0,NULL,NULL,0,12324,NULL)